import React, { Component } from 'react'

export class Profile extends Component {
  constructor(props) {
    super(props)

    this.state = {
      name: "",
			password: "",
			email: "",
			phone: "",
      address:{
        street: "",
        city: "",
        state: "",
        pincode: ""
      }
    }
  }
  render() {
    return (
      <div>Profile</div>
    )
  }
}

export default Profile
